import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Signup from './Components/Auth/Signup';

const Routes = () => {
    return (
        <BrowserRouter>
            <Switch>
                <Route exact path="signup" component={Signup} />
            </Switch>
        </BrowserRouter>
    );
};

export default Routes;
